const INITIAL_STATE = {
    section :[
        {
        title:'hats', 
        id:1,
        linkUrl:'shop/hats',
    imageurl:'https://www.irishtweeds.com/image/cache/data/aHatman%20Aussie/Wax-Hat-Aussie-Style---Back-600x600.jpg'
     },
        {
            title:'Caps',
            id:2,
            linkUrl:'shop/caps',
            imageurl:'https://m.media-amazon.com/images/I/81vECcJNbhL._AC_UL320_.jpg'
            },
            {
                title:'Shoes',
                id:3,
                linkUrl:'shop/shoes',
                imageurl:'https://www.lulus.com/images/product/xlarge/4950050_1102382.jpg?w=560'
                },
                {
                    title:'jackets',
                    id:4,
                    linkUrl:'shop/jackets',
                    imageurl:'https://m.media-amazon.com/images/I/610Py6tc6TL._AC_UL320_.jpg'
                    },
                    {
                        title:'Sneakers',
                        id:5,
                        linkUrl:'shop/Sneakers',
                        imageurl:'https://unsplash.com/photos/zw_oaDbfzyE'
                        }
                                                
    ]
}

const directoryReducer = (state = INITIAL_STATE, action) =>{
    switch (action.type){
        default:
        return state
    }
}

export default directoryReducer;
